import styled from 'styled-components';
const Category = ({ categoryList, onClick }) => {
  //   const categoryComponentList = categoryList.map((el) => {
  //     <CategoryContent>{el.name}</CategoryContent>;
  //   });
  //   console.log(categoryComponentList);
  return (
    <CategoryBox>
      {categoryList.map((name) => (
        <CategoryContent key={name} onClick={onClick}>
          {name.name}
        </CategoryContent>
      ))}
    </CategoryBox>
  );
};
export default Category;

const CategoryContent = styled.button`
  padding: 15px;
  margin: 3px;
  border-radius: 8px;
  background-color: rgba(10, 10, 35, 0.8);
  color: #ffffff;
  &:hover {
    background-color: rgba(40, 40, 65, 0.8);
    transition: 0.5s;
  }
`;
const CategoryBox = styled.div`
  border-radius: 10px;
  margin: 5px;
  padding: 10px;
  display: flex;
  flex-wrap: wrap;
  justify-contenet: center;
  background-color: #d9d9d9;
`;
